import React from 'react';
import './OvenItem.css';
import Loader from "../reusableComponents/Loader";


class OvenItem extends React.Component{

    constructor(props) {
        super(props);

    }
    checkPropSize(){
        let cnt=0;
        for(var k in this.props.data){
            cnt++;}
        return cnt>1 ? true :  false
    }
    ovenState(state){
        if (state== 'Active')
            return (<div><span className="dot green"/></div>)
        else return (<div><span className="dot yellow"/></div>)
    }
    render(){

    let ovenview=null;
    let view=null;
    // let setupsArr=setupData.data;


    // view=Object.entries(this.props.data).forEach(([key,value])=>{})
    // view=this.props.data.map((key)=>{
    //     return (
    //         <div className="oven-wrapper">
    //             <div className="oven-section1">
    //                 <div>State: {}</div>
    //                 <div>Name</div>
    //                 <div> CurrentTemperature</div>
    //             </div>
    //             <div className="oven-section2">
    //                 Profile:  Goal:
    //             </div>
    //             <div className="oven-section3">
    //                 <div>ready: </div>
    //                 <div>available</div>
    //                 <div>found</div>
    //                 <div>NF</div>
    //                 <div>NA</div>
    //             </div>
    //             <div className="oven-section4">
    //                 analytics
    //             </div>
    //         </div>
    //     )
    // })

    if( this.props.data.get("Name")!= null ) {
        const data=this.props.data;
        console.log(data.get("Name"));
        ovenview = <div className="oven-wrapper" key={data.get("Name")}>
            <div className="oven-section1">
                <div>{this.ovenState(data.get("State"))} </div>
                <div>{data.get("Name")}</div>
                <div> CurrentTemperature {data.get("CurrentTemperature")}</div>
            </div>
            <div className="oven-section2">
                Profile:{data.get("Profile")}  Goal:{data.get("GoalTemperature")}
            </div>
            <div className="oven-section3">
                <div>ready: {}</div>
                <div>available</div>
                <div>found</div>
                <div>NF</div>
                <div>NA</div>
            </div>
            <div className="oven-section4">
                analytics
            </div>
        </div>
    }


    return(
        <div>
            {ovenview ? ovenview : <Loader/>}
        </div>
    )
}
}

export default OvenItem;
